void affine(QRule_tri &table) {
    // some constants.
    double half = 0.50000000000000000000000000000000;
    double gamma = 0.57735026918962576450914878050196;
    double theta = 0.33333333333333333333333333333333;

    double af_x, af_y, sumw = 0.0000000000000000000000000000000;
    for (size_t id = 0; id < table.points_x.size(); ++id) {
        af_x = half * table.points_x[id] - gamma * table.points_y[id] / 2.0 + theta;
        af_y = gamma * table.points_y[id] + theta;
        table.points_x[id] = af_x;
        table.points_y[id] = af_y;
        sumw += table.weights[id];
    }


    for (size_t id = 0; id < table.points_x.size(); ++id) {
        table.weights[id] /= sumw;
        table.weights[id] *= half;
    }
}

